import React from "react";

import { Grommet, Heading, Box, Grid, Button } from "grommet";
import { Trash } from "grommet-icons";

function DeleteTodo() {
  return (
    <Grommet>
      <Box fill align="center" justify="center">
        <Button
          plain={false}
          icon={<Trash />}
          label="Delete"
          margin="small"
          margin={{ top: "large" }}
        />
      </Box>
    </Grommet>
  );
}

export default DeleteTodo;
